// DicomViewer.js
import React, { useState } from 'react';

const DicomViewer = () => {
  const [files, setFiles] = useState([]);
  const [uploadId, setUploadId] = useState(null);
  const [fileCount, setFileCount] = useState(0);
  const [viewMode, setViewMode] = useState('2d');
  const [loading, setLoading] = useState(false);
  const [processing, setProcessing] = useState(false);
  const [resultImage, setResultImage] = useState(null);
  const [error, setError] = useState(null);

  const API_URL = 'http://localhost:5001';

  const handleFileChange = (e) => {
    if (e.target.files && e.target.files.length > 0) {
      setFiles(Array.from(e.target.files));
      setFileCount(e.target.files.length);
      setUploadId(null);
      setResultImage(null);
      setError(null);
    }
  };

  const uploadFiles = async () => {
    if (files.length === 0) {
      setError('Please select files to upload');
      return;
    }

    setLoading(true);
    setError(null);

    const formData = new FormData();
    files.forEach(file => {
      formData.append('files[]', file);
    });

    try {
      const response = await fetch(`${API_URL}/upload`, {
        method: 'POST',
        body: formData
      });

      const data = await response.json();
      if (!response.ok) throw new Error(data.error || 'Upload failed');

      setUploadId(data.upload_id);
      setFileCount(data.file_count);
    } catch (error) {
      setError(`Error uploading files: ${error.message}`);
    } finally {
      setLoading(false);
    }
  };

  const processFiles = async () => {
    if (!uploadId) {
      setError('Please upload files first');
      return;
    }

    setProcessing(true);
    setError(null);

    try {
      const response = await fetch(`${API_URL}/process`, {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({ upload_id: uploadId, view_type: viewMode })
      });

      const data = await response.json();
      if (!response.ok) throw new Error(data.error || 'Processing failed');

      if (data.success && data.images && data.images.length > 0) {
        setResultImage(`${API_URL}${data.images[0]}`);
      } else {
        throw new Error('No images were generated');
      }
    } catch (error) {
      setError(`Error processing files: ${error.message}`);
    } finally {
      setProcessing(false);
    }
  };

  return (
    <div className="flex flex-col h-screen bg-gray-100">
      <div className="bg-gray-800 text-white p-4">
        <h1 className="text-2xl font-bold">NELSVIEW: Views DICOM Images</h1>
      </div>
      <div className="flex-1 flex flex-col md:flex-row p-4 space-y-4 md:space-y-0 md:space-x-4">
        <div className="w-full md:w-1/4 bg-white rounded-lg shadow p-4">
          <h2 className="text-xl font-semibold mb-4">Controls</h2>
          <input
            type="file"
            multiple
            accept=".dcm,.ima"
            onChange={handleFileChange}
            className="mb-2 w-full"
          />
          <button onClick={uploadFiles} disabled={loading || files.length === 0} className="btn">
            {loading ? 'Uploading...' : 'Upload Files'}
          </button>

          {uploadId && (
            <>
              <div className="my-2">
                <label>View Mode:</label>
                <div>
                  <button onClick={() => setViewMode('2d')} className={`btn ${viewMode === '2d' ? 'btn-primary' : ''}`}>2D</button>
                  <button onClick={() => setViewMode('3d')} className={`btn ${viewMode === '3d' ? 'btn-primary' : ''}`}>3D</button>
                </div>
              </div>
              <button onClick={processFiles} disabled={processing} className="btn">
                {processing ? 'Processing...' : 'Process DICOM Files'}
              </button>
              <div>{fileCount} DICOM file(s) uploaded</div>
            </>
          )}
        </div>

        <div className="w-full md:w-3/4 bg-white rounded-lg shadow p-4">
          <h2 className="text-xl font-semibold mb-4">{viewMode === '3d' ? '3D Hologram Viewer' : 'DICOM Slice Viewer'}</h2>
          <div className="flex-1 relative">
            {error && <div className="text-red-500">{error}</div>}
            {viewMode === '3d' && resultImage && (
              <iframe src={resultImage} className="w-full h-[600px]" title="3D Viewer" />
            )}
            {viewMode === '2d' && resultImage && (
              <img src={resultImage} alt="DICOM Slice" className="max-w-full max-h-full mx-auto" />
            )}
          </div>
        </div>
      </div>
      <div className="bg-gray-800 text-white text-center p-2 text-sm">NELSVIEW - Â© 2025</div>
    </div>
  );
};

export default DicomViewer;
